import React, {Component} from 'react';
import Navbar from './Navbar';
import './Work.css';

class Work extends Component {
    render() {
        return (
            <div> 
                <Navbar page="work"/>
                <div className="workPage">
                    <h1 className="workHeader"> WROK
                    </h1>
                </div>    
            </div>
        );
    }
}

export default Work;
